_ID&quot;\n}\nelse if (whatDomainsReturned == &quot;IHEBLUE&amp;1.3.6.1.4.1.21367.13.20.3000&amp;ISO&quot;) {    \n    returningDomainColumn = &quot;BLUE_ID&quot;\n}\n\nif (msg[&apos;QPD&apos;][&apos;QPD.3&apos;][&apos;QPD.3.4&apos;].toString() == &quot;IHEFACILITY&amp;1.3.6.1.4.1.21367.3000.1.6&amp;ISO&quot;) {\n    currentDomainColumn = &quot;FACILITY_ID&quot;;\n    logger.info(&quot;Current domain is: FACILITY&quot;);\n    query = new java.lang.String(&quot;SELECT RED_ID, BLUE_ID, GREEN_ID from demographics_data WHERE FACILITY_ID = &quot;);\n}\nelse if (msg[&apos;QPD&apos;][&apos;QPD.3&apos;][&apos;QPD.3.4&apos;].toString() == &quot;IHERED&amp;1.3.6.1.4.1.21367.13.20.1000&amp;ISO&quot;) {\n    currentDomainColumn = &quot;RED_ID&quot;;\n    logger.info(&quot;Current domain is: RED&quot;);\n    query = new java.lang.String(&quot;SELECT BLUE_ID, GREEN_ID, FACILITY_ID from demographics_data WHERE RED_ID = &quot;);\n}\nelse if (msg[&apos;QPD&apos;][&apos;QPD.3&apos;][&apos;QPD.3.4&apos;].toString() == &quot;IHEGREEN&amp;1.3.6.1.4.1.21367.13.20.2000&amp;ISO&quot;) {\n    currentDomainColumn = &quot;GREEN_ID&quot;;\n    logger.info(&quot;Current domain is: GREEN&quot;);\n    query = new java.lang.String(&quot;SELECT RED_ID, BLUE_ID, FACILITY_ID from demographics_data WHERE GREEN_ID = &quot;);\n}\nelse{\n    currentDomainColumn = &quot;BLUE_ID&quot;;\n    logger.info(&quot;Current domain is: BLUE&quot;);\n    query = new java.lang.String(&quot;SELECT RED_ID, GREEN_ID, FACILITY_ID from demographics_data WHERE BLUE_ID =&quot;);\n}\n//add the parameter part to the query \n\nquery += &quot;&apos;&quot; + SerializerFactory.getSerializer(&apos;HL7V2&apos;).fromXML(msg[&apos;QPD&apos;][&apos;QPD.3&apos;]).toString() + &quot;&apos;&quot;;\n\nlogger.info(&quot;Final PIX query is: &quot; + query)</script>\n          </com.mirth.connect.plugins.javascriptstep.JavaScriptStep>\n          <com.mirth.connect.plugins.javascriptstep.JavaScriptStep version="4.5.1">\n            <name>RSP segments message templates</name>\n            <sequenceNumber>2</sequenceNumber>\n            <enabled>true</enabled>\n            <script>importPackage(java.util)\n\nfunction fill_msh(){\n    var sending_application = &apos;ARS_APP&apos;\n    var sending_facility = &apos;ARS_XREF_MGR&apos;\n    var receiving_application = msg[&apos;MSH&apos;][&apos;MSH.3&apos;][&apos;MSH.3.1&apos;].toString()\n    var receiving_facility = msg[&apos;MSH&apos;][&apos;MSH.4&apos;][&apos;MSH.4.1&apos;].toString()\n    var datetime_of_message = DateUtil.getCurrentDate(&quot;yyyyMMddHHmmss&quot;);\n    var message_control_id = UUIDGenerator.getUUID();\n    var processing_id_code = &apos;D&apos;\n    var processing_id_desc = &apos;Debugging&apos;\n    var country_code = &apos;IT&apos;\n    var principal_msg_language = &apos;EN&apos;\n\n\n //msh mapping\n //var msh = getMSHTemplate(false)\n \n    tmp[&apos;MSH&apos;][&apos;MSH.3&apos;][&apos;MSH.3.1&apos;] = sending_application\n    tmp[&apos;MSH&apos;][&apos;MSH.4&apos;][&apos;MSH.4.1&apos;] = sending_facility\n    tmp[&apos;MSH&apos;][&apos;MSH.5&apos;][&apos;MSH.5.1&apos;] = receiving_application\n    tmp[&apos;MSH&apos;][&apos;MSH.6&apos;][&apos;MSH.6.1&apos;] = receiving_facility\n    tmp[&apos;MSH&apos;][&apos;MSH.7&apos;][&apos;MSH.7.1&apos;] = datetime_of_message\n    tmp[&apos;MSH&apos;][&apos;MSH.10&apos;] = message_control_id\n    tmp[&apos;MSH&apos;][&apos;MSH.11&apos;][&apos;MSH.11.1&apos;] = processing_id_code\n    tmp[&apos;MSH&apos;][&apos;MSH.11&apos;][&apos;MSH.11.2&apos;] = processing_id_desc\n    tmp[&apos;MSH&apos;][&apos;MSH.17&apos;] = country_code\n    tmp[&apos;MSH&apos;][&apos;MSH.19&apos;][&apos;MSH.19.1&apos;] = principal_msg_language\n}\n\nfunction fill_msa(return_code,error_code) {\n    tmp[&apos;MSA&apos;][&apos;MSA.1&apos;] = return_code\n    tmp[&apos;MSA&apos;][&apos;MSA.2&apos;] = msg[&apos;MSH&apos;][&apos;MSH.10&apos;][&apos;MSH.10.1&apos;].toString()\n    tmp[&apos;MSA&apos;][&apos;MSA.3&apos;] = erro