d5512f97-6e0f-4008-8543-4a6a1e5ad108	PDQ_SERVER_ACTOR_LOCAL_DOMAIN	4	<channel version="4.5.1">\n  <id>d5512f97-6e0f-4008-8543-4a6a1e5ad108</id>\n  <nextMetaDataId>3</nextMetaDataId>\n  <name>PDQ_SERVER_ACTOR_LOCAL_DOMAIN</name>\n  <description>This channel implements the IHE PDQ profile. Receives as input a QBP^Q22^QBP_Q21, and recovers from it all query fields. Then, forwards as a sql query to a database, in order to recover all patients satisfying it. The answer is a RSP_K22 message containing multiple PID segments, one for each patient satisfying the input query.\n</description>\n  <revision>4</revision>\n  <sourceConnector version="4.5.1">\n    <metaDataId>0</metaDataId>\n    <name>sourceConnector</name>\n    <properties class="com.mirth.connect.connectors.tcp.TcpReceiverProperties" version="4.5.1">\n      <pluginProperties/>\n      <listenerConnectorProperties version="4.5.1">\n        <host>0.0.0.0</host>\n        <port>6662</port>\n      </listenerConnectorProperties>\n      <sourceConnectorProperties version="4.5.1">\n        <responseVariable>PDQsynchAck</responseVariable>\n        <respondAfterProcessing>true</respondAfterProcessing>\n        <processBatch>false</processBatch>\n        <firstResponse>true</firstResponse>\n        <processingThreads>1</processingThreads>\n        <resourceIds class="linked-hash-map">\n          <entry>\n            <string>Default Resource</string>\n            <string>[Default Resource]</string>\n          </entry>\n        </resourceIds>\n        <queueBufferSize>1000</queueBufferSize>\n      </sourceConnectorProperties>\n      <transmissionModeProperties class="com.mirth.connect.plugins.mllpmode.MLLPModeProperties">\n        <pluginPointName>MLLP</pluginPointName>\n        <startOfMessageBytes>0B</startOfMessageBytes>\n        <endOfMessageBytes>1C0D</endOfMessageBytes>\n        <useMLLPv2>false</useMLLPv2>\n        <ackBytes>06</ackBytes>\n        <nackBytes>15</nackBytes>\n        <maxRetries>2</maxRetries>\n      </transmissionModeProperties>\n      <serverMode>true</serverMode>\n      <remoteAddress></remoteAddress>\n      <remotePort></remotePort>\n      <overrideLocalBinding>false</overrideLocalBinding>\n      <reconnectInterval>5000</reconnectInterval>\n      <receiveTimeout>0</receiveTimeout>\n      <bufferSize>65536</bufferSize>\n      <maxConnections>10</maxConnections>\n      <keepConnectionOpen>true</keepConnectionOpen>\n      <dataTypeBinary>false</dataTypeBinary>\n      <charsetEncoding>DEFAULT_ENCODING</charsetEncoding>\n      <respondOnNewConnection>0</respondOnNewConnection>\n      <responseAddress></responseAddress>\n      <responsePort></responsePort>\n    </properties>\n    <transformer version="4.5.1">\n      <elements/>\n      <inboundTemplate encoding="base64"></inboundTemplate>\n      <outboundTemplate encoding="base64"></outboundTemplate>\n      <inboundDataType>HL7V2</inboundDataType>\n      <outboundDataType>HL7V2</outboundDataType>\n      <inboundProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2DataTypeProperties" version="4.5.1">\n        <serializationProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2SerializationProperties" version="4.5.1">\n          <handleRepetitions>true</handleRepetitions>\n          <handleSubcomponents>false</handleSubcomponents>\n          <useStrictParser>false</useStrictParser>\n          <useStrictValidation>false</useStrictValidation>\n          <stripNamespaces>false</stripNamespaces>\n          <segmentDelimiter>\\r</segmentDelimiter>\n          <convertLineBreaks>true</convertLineBreaks>\n        </serializationProperties>\n        <deserializationProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2DeserializationProperties" version="4.5.1">\n          <useStrictParser>true</useStrictParser>\n          <useStrictValidation>true</useStrictValidation>\n          <segmentDelimiter>\\r</segmentDelimiter>\n        </deserializationProperties>\n        <batchProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2BatchProperties" version="4.5.1">\n          <splitType>MSH_Segment</splitType>\n          <batchScript></batchScript>\n        </batchProperties>\n        <responseGenerationProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2ResponseGenerationProperties" version="4.5.1">\n          <segmentDelimiter>\\r</segmentDelimiter>\n          <successfulACKCode>AA</successfulACKCode>\n          <successfulACKMessage></successfulACKMessage>\n          <errorACKCode>AE</errorACKCode>\n          <errorACKMessage>An Error Occured Processing Message.</errorACKMessage>\n          <rejectedACKCode>AR</rejectedACKCode>\n          <rejectedACKMessage>Message Rejected.</rejectedACKMessage>\n          <msh15ACKAccept>false</msh15ACKAccept>\n          <dateFormat>yyyyMMddHHmmss</dateFormat>\n        </responseGenerationProperties>\n        <responseValidationProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2ResponseValidationProperties" version="4.5.1">\n          <successfulACKCode>AA,CA</successfulACKCode>\n          <errorACKCode>AE,CE</errorACKCode>\n          <rejectedACKCode>AR,CR</rejectedACKCode>\n          <validateMessageControlId>false</validateMessageControlId>\n          <originalMessageControlId>Destination_Encoded</originalMessageControlId>\n          <originalIdMapVariable></originalIdMapVariable>\n        </responseValidationProperties>\n      </inboundProperties>\n      <outboundProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2DataTypeProperties" version="4.5.1">\n        <serializationProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2SerializationProperties" version="4.5.1">\n          <handleRepetitions>true</handleRepetitions>\n          <handleSubcomponents>false</handleSubcomponents>\n          <useStrictParser>true</useStrictParser>\n          <useStrictValidation>true</useStrictValidation>\n          <stripNamespaces>false</stripNamespaces>\n          <segmentDelimiter>\\r</segmentDelimiter>\n          <convertLineBreaks>true</convertLineBreaks>\n        </serializationProperties>\n        <deserializationProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2DeserializationProperties" version="4.5.1">\n          <useStrictParser>false</useStrictParser>\n          <useStrictValidation>false</useStrictValidation>\n          <segmentDelimiter>\\r</segmentDelimiter>\n        </deserializationProperties>\n        <batchProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2BatchProperties" version="4.5.1">\n          <splitType>MSH_Segment</splitType>\n          <batchScript></batchScript>\n        </batchProperties>\n        <responseGenerationProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2ResponseGenerationProperties" version="4.5.1">\n          <segmentDelimiter>\\r</segmentDelimiter>\n          <successfulACKCode>AA</successfulACKCode>\n          <successfulACKMessage></successfulACKMessage>\n          <errorACKCode>AE</errorACKCode>\n          <errorACKMessage>An Error Occured Processing Message.</errorACKMessage>\n          <rejectedACKCode>AR</rejectedACKCode>\n          <rejectedACKMessage>Message Rejected.</rejectedACKMessage>\n          <msh15ACKAccept>false</msh15ACKAccept>\n          <dateFormat>yyyyMMddHHmmss</dateFormat>\n        </responseGenerationProperties>\n        <responseValidationProperties class="com.mirth.connect.plugins.datatypes.hl7v2.HL7v2ResponseValidationProperties" version="4.5.1">\n          <successfulACKCode>AA,CA</successfulACKCode>\n          <errorACKCode>AE,CE</errorACKCode>\n          <rejectedACKCode>AR,CR</rejectedACKCode>\n          <validateMessageControlId>false</validateMessageControlId>\n          <originalMessageControlId>Destination_Encoded</originalMessageControlId>\n          <originalIdMapVariable></originalIdMapVariable>\n        </responseValidationProperties>\n      </outboundProperties>\n    </transformer>\n    <filter version="4.5.1">\n      <elements/>\n    </filter>\n    <transportName>TCP Listener</transportName>\n    <mode>SOURCE</mode>\n    <enabled>true</enabled>\n    <waitForPrevious>true</waitForPrevious>\n  </sourceConnector>\n  <destinationConnectors>\n    <connector version="4.5.1">\n      <metaDataId>1</metaDataId>\n      <name>PDQRequestSuccessDestination</name>\n      <properties class="com.mirth.connect.connectors.js.JavaScriptDispatcherProperties" version="4.5.1">\n        <pluginProperties/>\n        <destinationConnectorProperties version="4.5.1">\n          <queueEnabled>false</queueEnabled>\n          <sendFirst>false</sendFirst>\n          <retryIntervalMillis>10000</retryIntervalMillis>\n          <regenerateTemplate>false</regenerateTemplate>\n          <retryCount>0</retryCount>\n          <rotate>false</rotate>\n          <includeFilterTransformer>false</includeFilterTransformer>\n          <threadCount>1</threadCount>\n          <validateResponse>false</validateResponse>\n          <resourceIds class="linked-hash-map">\n            <entry>\n              <string>Default Resource</string>\n              <string>[Default Resource]</string>\n            </entry>\n          </resourceIds>\n          <queueBufferSize>1000</queueBufferSize>\n          <reattachAttachments>true</reattachAttachments>\n        </destinationConnectorProperties>\n        <script>logger.info(&apos;encoded response: &apos; + connectorMessage.getEncodedData())\nresponseMap.put(&apos;PDQsynchAck&apos;, ResponseFactory.getSentResponse(connectorMessage.getEncodedData()))</script>\n      </properties>\n      <transformer version="4.5.1">\n        <elements>\n          <com.mirth.connect.plugins.javascriptstep.JavaScriptStep version="4.5.1">\n            <name>Channel error global variable and other channel parameters</name>\n            <sequenceNumber>0</sequenceNumber>\n            <enabled>true</enabled>\n            <script>//error global variable, successively modified according to errors\nvar CHANNEL_NAME = ChannelUtil.getDeployedChannelName(channelId);\nvar error_control = {}\n\nerror_control[&apos;code&apos;] = &apos;000&apos;\nerror_control[&apos;desc&apos;] = &apos;NO ERROR&apos;\n\nchannelMap.put(&apos;error_control&apos;,error_control)\n\n//pdq supplier database information\nvar pdq_db_params = {}\n\npdq_db_params[&apos;driver&apos;] \t= &quot;org.postgresql.Driver&quot;\npdq_db_params[&apos;url&apos;]= &quot;jdbc:postgresql://db:5432/mirthdb&quot;\npdq_db_params[&apos;user&apos;]   \t= &quot;mirthuser&quot;\npdq_db_params[&apos;password&apos;]   = &quot;mirthpass&quot;\n\nchannelMap.put(&apos;pdq_db_params&apos;,pdq_db_params)</script>\n          </com.mirth.connect.plugins.javascriptstep.JavaScriptStep>\n          <com.mirth.connect.plugins.javascriptstep.JavaScriptStep version="4.5.1">\n            <name>Extract Query fields from input message</name>\n            <sequenceNumber>1</sequenceNumber>\n            <enabled>true</enabled>\n            <script>/*This step examines the incoming message and extracts all query fields contained. Remember that IHE defines these query fields:\n\n@PID.3 Patient Identifier List\n@PID.5 Patient Name\n@PID.7 Date/Time of Birth\n@PID.8 Administrative Sex\n@PID.11 Patient Address\n@PID.18 Patient Account Numb\n\nIMPORTANT NOTE: AT LEAST one of the fields above must be valued. Subfields like @PID.5.1 ARE NOT recognized by the parser: so,\nUNKNOWN.1 tag WILL NOT EVEN contain the same query field. A control of QPD.3 message subfields is always needed \n*/\n\nmsg[&apos;QPD&apos;][&apos;QPD.3&apos;][0].toString()\nmsg[&apos;QPD&apos;][&apos;QPD.3&apos;][0][&apos;QPD.3.1&apos;].toString()\n\nvar query_fields = {} //keep memory of query fields\n\nfor (var i=0; i&lt; (msg[&apos;QPD&apos;][&apos;QPD.3&apos;]).length(); i++) {\n    var field_name  = msg[&apos;QPD&apos;][&apos;QPD.3&apos;][i][&apos;QPD.3.1&apos;].toString();\n    var field_value = msg[&apos;QPD&apos;][&apos;QPD.3&apos;][i][&apos;QPD.3.2&apos;].toString();\n    logger.info(&quot;MSG*****PARAM: &quot; + field_name);\n    query_fields[field_name] = field_value;\n}\n\n//Build where clause by all query fields\nfor (key in query_fields){\n    logger.info(&apos;KEY:&apos;+key.toString())\n}\n\n//check variable &quot;what domain returned&quot;\n//var whatDomainsReturned = &quot;&quot;;\n//if(msg[&apos;QPD&apos;][&apos;QPD.8&apos;].toString() == &quot;^^^^NIST2010&quot;){\n//    whatDomainsReturned = &quot;NIST2010&quot;;\n//}</script>\n          </com.mirth.connect.plugins.javascriptstep.JavaScriptStep>\n          <com.mirth.connect.plugins.javascriptstep.JavaScriptStep version="4.5.1">\n            <name>PDQ Query and Patient Information Mapping</name>\n            <sequenceNumber>2</sequenceNumber>\n            <enabled>true</enabled>\n            <script>/*This channel is a generic and IHE compliant PDQ. It means that all fields in the SELECT and WHERE clause have a \nfixed name. In order to connect a Demographic Database, a view or a materialized view is needed in order to match\nthe channel names for all fields. \nEven if the PDQ Demographic provider may return only query values for each matching value, this channel is implemented to\nbe able to return all PID information it is able to recover. \n*/\nimportPackage(java.lang)\n\nvar select_fields_mapping \t= {}\nvar where_fields_mapping \t= {}\n\nselect_table_name\t\t\t\t\t\t\t\t= &apos;pdq.pdq_local_domain&apos;//&apos;DEMOGRAPHICS&apos;    //Bug with mysql in linux (This should be lowercase)\n\n//if (whatDomainsReturned == &quot;&quot;){\n    select_fields_mapping[&apos;PID_3_1&apos;] \t    = &quot;RED_ID&quot;\n    select_fields_mapping[&apos;PID_3&apos;] =select_fields_mapping[&apos;PID_3_1&apos;] \n//}\n//else {\n//    select_fields_mapping[&apos;PID_3_1&apos;] = &quot;NIST_ID&quot;\t\n//    select_fields_mapping[&apos;PID_3&apos;] = select_fields_mapping[&apos;PID_3_1&apos;]\n//}\n\n//select_fields_mapping[&apos;PID_3_1_CX1&apos;] \t    = &apos;FISCAL_CODE&apos;\n//select_fields_mapping[&apos;PID_3_4&apos;] = \n//select_fields_mapping[&apos;PID_3_4_1&apos;]     =  &apos;ass_auth_nmsp_id&apos;\n//select_fields_mapping[&apos;PID_3_4_2&apos;]     = &apos;ass_auth_uni_id&apos;\n//select_fields_mapping[&apos;PID_3_4_3&apos;]     = &apos;ass_auth_uni_id_type&apos;\n//select_fields_mapping[&apos;PID_3_5&apos;]     = &apos;id_type_code&apos;\nselect_fields_mapping[&apos;PID5_1_1&apos;] = &apos;LAST_NAME&apos;\nselect_fields_mapping[&apos;PID5_2&apos;] = &apos;FIRST_NAME&apos;\nselect_fields_mapping[&apos;PID7_1&apos;] = &apos;DATE_OF_BIRTH&apos;\nselect_fields_mapping[&apos;PID8&apos;]\t= &apos;GENDER&apos;\n//select_fields_mapping[&apos;PID10&apos;]\t\t\t\t= &apos;RACE&apos;\nselect_fields_mapping[&apos;PID11_1_1&apos;]\t= &apos;ADDRESS&apos;\nselect_fields_mapping[&apos;PID11_3&apos;] = &apos;CITY&apos;\nselect_fields_mapping[&apos;PID11_4&apos;] = &apos;COUNTRY&apos;\nselect_fields_mapping[&apos;PID11_5&apos;] = &apos;ZIP_CODE&apos;\n//select_fields_mapping[&apos;PID11_0_XAD9&apos;]\t= &apos;CITY_ISTAT&apos;\n\n//select_fields_mapping[&apos;PID13&apos;] = &apos;TELEPHONE_NUMBER&apos;\n//select_fields_mapping[&apos;PID14&apos;] = &apos;TELEPHONE_NUMBER&apos;\n//select_fields_mapping[&apos;PID16&apos;] = &apos;MARITAL_STATUS&apos;\n//select_fields_mapping[&apos;PID23&apos;] = &apos;BIRTH_CITY&apos;\n//select_fields_mapping[&apos;PID26&apos;] = &apos;CITIZENSHIP&apos;\n\n/**OLD PDQ IMPLEMENYATATION. FIELDS UNIFIED TO LAB-62 LIP\nselect_fields_mapping[&apos;PID_3_CX1&apos;] = &apos;ID_NUMBER&apos;\nselect_fields_mapping[&apos;PID_3_CX4_HD1&apos;]  = &apos;ASSIGNING_AUTHORITY&apos;\nselect_fields_mapping[&apos;PID5_XPN1_FN1&apos;] = &apos;SURNAME&apos;\nselect_fields_mapping[&apos;PID5_XPN2&apos;] = &apos;NAME&apos;\nselect_fields_mapping[&apos;PID7_TS1&apos;] = &apos;DATETIME_OF_BIRTH&apos;\nselect_fields_mapping[&apos;PID8&apos;] = &apos;ADMINISTRATIVE_SEX&apos;\nselect_fields_mapping[&apos;PID10&apos;] = &apos;RACE&apos;\n//birth place\nselect_fields_mapping[&apos;PID11_B_XAD3&apos;] = &apos;CITY&apos;\n//legal address\nselect_fields_mapping[&apos;PID11_L_XAD1_SAD1&apos;] = &apos;STREET_ADDRESS&apos;\n//select_fields_mapping[&apos;PID11_L_XAD1_SAD2&apos;] = &apos;STREET_ADDRESS_NUMBER&apos;\nselect_fields_mapping[&apos;PID11_L_XAD3&apos;] = &apos;CITY&apos;\nselect_fields_mapping[&apos;PID11_L_XAD4&apos;] = &apos;STATE_OR_PROVINCE&apos;\nselect_fields_mapping[&apos;PID11_L_XAD5&apos;] = &apos;ZIP_CODE&apos;\n//home address\nselect_fields_mapping[&apos;PID11_H_XAD1_SAD1&apos;] = &apos;STREET_ADDRESS&apos;\n//select_fields_mapping[&apos;PID11_H_XAD1_SAD2&apos;] = &apos;STREET_ADDRESS_NUMBER&apos;\nselect_fields_mapping[&apos;PID11_H_XAD3&apos;] = &apos;CITY&apos;\nselect_fields_mapping[&apos;PID11_H_XAD4&apos;] = &apos;STATE_OR_PROVINCE&apos;\nselect_fields_mapping[&apos;PID11_H_XAD5&apos;] = &apos;ZIP_CODE&apos;\nselect_fields_mapping[&apos;PID18&apos;] = &apos;ACCOUNT_NUMBER&apos;\nale ok\nselect_fields_mapping[&apos;PID11_XAD1_SAD1&apos;] = &apos;STREET_ADDRESS&apos;\nselect_fields_mapping[&apos;PID11_XAD3&apos;] = &apos;CITY&apos;\nselect_fields_mapping[&apos;PID11_XAD4&apos;] = &apos;STATE_OR_PROVINCE&apos;\nselect_fields_mapping[&apos;PID11_XAD5&apos;] = &apos;ZIP_CODE&apos;\nselect_fields_mapping[&apos;PID18&apos;] = &apos;ACCOUNT_NUMBER&apos;\n*/\n\nwhere_fields_mapping[&apos;@PID.3&apos;] = &apos;RED_ID&apos;\nwhere_fields_mapping[&apos;@PID.3.1&apos;] = &apos;RED_ID&apos;\nwhere_fields_mapping[&apos;@PID.5.1.1&apos;] = &apos;LAST_NAME&apos;\nwhere_fields_mapping[&apos;@PID.5.2&apos;] = &apos;FIRST_NAME&apos;\nwhere_fields_mapping[&apos;@PID.7.1&apos;] = &apos;DATE_OF_BIRTH&apos;\nwhere_fields_mapping[&apos;@PID.8&apos;] = &apos;GENDER&apos;\nwhere_fields_mapping[&apos;@PID.11.1.1&apos;] = &apos;ADDRESS&apos;\nwhere_fields_mapping[&apos;@PID.11.3&apos;] = &apos;CITY&apos;\nwhere_fields_mapping[&apos;@PID.11.4&apos;] = &apos;COUNTRY&apos;\nwhere_fields_mapping[&apos;@PID.11.5&apos;] = &apos;ZIP_CODE&apos;\n\n//PID.11: it is not sure on which field to filter, assume it to be CITY\n//where_fields_mapping[&apos;@PID.18&apos;]\t\t\t\t= &apos;ACCOUNT_NUMBER&apos;\t\t\n//PID.18: at the moment assume to be only account number\n\n//build select\nvar addselect = new java.lang.String(&apos;SELECT \\n&apos;)\nfor (key in select_fields_mapping){\n    addselect += select_fields_mapping[key] + &quot;,\\n&quot;\n}\n//delete the last comma.This is the first part of the query\nvar select = addselect.substring(0,addselect.length-2) + &apos; \\n&apos; \n\n//build where clause\nvar addwhere = new java.lang.String(&apos;WHERE \\n&apos;)\nfor(key in query_fields) {\n    // for name and surname also some initial matching characters are accepted\n    if (key == &apos;@PID.5.1.1&apos; || key == &apos;@PID.5.2&apos;) {\n        addwhere += where_fields_mapping[key] + &quot; like &apos;&quot; + query_fields[key].replace(&quot;*&quot;,&quot;%&quot;) + &quot;&apos; AND \\n&quot;\n    }\n    // for other query fields, not\n    else if (key == &quot;@PID.3.1&quot;) {\n        addwhere += where_fields_mapping[key] + &quot; = &apos;&quot; + query_fields[&quot;@PID.3.1&quot;]+&quot;^^^&quot;+query_fields[&quot;@PID.3.4.1&quot;]+&quot;&amp;&quot;+query_fields[&quot;@PID.3.4.2&quot;] + &quot;&amp;&quot;+query_fields[&quot;@PID.3.4.3&quot;]+ &quot;&apos; AND \\n&quot;\n    }\n    else if (key == &quot;@PID.3.4.1&quot; || key == &quot;@PID.3.4.2&quot; || key == &quot;@PID.3.4.3&quot; ) {\n\t\tlogger.info(&quot;Skip param&quot;);\n    }\n    else if (key == &quot;@PID.7.1&quot;) {\n        addwhere += where_fields_mapping[key] + &quot; = &apos;&quot; + DateUtil.convertDate(&apos;yyyymmdd&apos;, &apos;yyyy-mm-dd&apos;, query_fields[key]) + &quot;&apos; AND \\n&quot;;\n    }\n    else{\n        addwhere += where_fields_mapping[key] + &quot; = &apos;&quot; + query_fields[key] + &quot;&apos; AND \\n&quot;;\n    }\n} \n\n//delete the last AND.This is the WHERE part of the query\nvar where = addwhere.substring(0,addwhere.length-5) + &apos; \\n&apos;;\n\n//reconstruct the global query\nvar query = select + \n            &apos;FROM &apos; + select_table_name + &apos;\\n&apos;+\n            where;</script>\n          </com.mirth.connect.plugins.javascriptstep.JavaScriptStep>\n          <com.mirth.connect.plugins.javascriptstep.JavaScriptStep version="4.5.1">\n            <name>RSP segments message templates</name>\n            <sequenceNumber>3</sequenceNumber>\n            <enabled>true</enabled>\n            <script>importPackage(java.util)\n\nfunction fill_msh() {\n    var sending_application = &apos;ARS_APP&apos;;\n    var sending_facility = &apos;ARS_PDQ_SUPPL&apos;;\n    var receiving_application = msg[&apos;MSH&apos;][&apos;MSH.3&apos;][&apos;MSH.3.1&apos;].toString();\n    var receiving_facility = msg[&apos;MSH&apos;][&apos;MSH.4&apos;][&apos;MSH.4.1&apos;].toString();\n    var datetime_of_message = DateUtil.getCurrentDate(&quot;yyyyMMddHHmmss&quot;);\n    var message_control_id = UUIDGenerator.getUUID();\n    var processing_id_code = &apos;D&apos;;\n    //var processing_id_desc = &apos;Debugging&apos;\n    var country_code = &apos;IT&apos;;\n    var principal_msg_language = &apos;EN&apos;;\n\n    //msh mapping\n    //var msh = getMSHTemplate(false)\n\t\n    tmp[&apos;MSH&apos;][&apos;MSH.3&apos;][&apos;MSH.3.1&apos;]\t= sending_application;\n    tmp[&apos;MSH&apos;][&apos;MSH.4&apos;][&apos;MSH.4.1&apos;] = sending_facility;\n    tmp[&apos;MSH&apos;][&apos;MSH.5&apos;][&apos;MSH.5.1&apos;]\t= receiving_application;\n    tmp[&apos;MSH&apos;][&apos;MSH.6&apos;][&apos;MSH.6.1&apos;]\t= receiving_facility;\n    tmp[&apos;MSH&apos;][&apos;MSH.7&apos;][&apos;MSH.7.1&apos;]\t= datetime_of_message;\n    tmp[&apos;MSH&apos;][&apos;MSH.10&apos;]\t= message_control_id;\n    tmp[&apos;MSH&apos;][&apos;MSH.11&apos;][&apos;MSH.11.1&apos;] = processing_id_code;\n    //tmp[&apos;MSH&apos;][&apos;MSH.11&apos;][&apos;MSH.11.2&apos;]= processing_id_desc\n    tmp[&apos;MSH&apos;][&apos;MSH.17&apos;]\t= country_code;\n    tmp[&apos;MSH&apos;][&apos;MSH.19&apos;][&apos;MSH.19.1&apos;] = principal_msg_language;\n}\n\nfunction fill_msa(return_code,error_code) {\n    tmp[&apos;MSA&apos;][&apos;MSA.1&apos;]\t= return_code;\n    tmp[&apos;MSA&apos;][&apos;MSA.2&apos;]\t= msg[&apos;MSH&apos;][&apos;MSH.10&apos;][&apos;MSH.10.1&apos;].toString();\n    tmp[&apos;MSA&apos;][&apos;MSA.3&apos;]\t= error_code;\n    //add msa segment to global response message\n}\n\nfunction fill_qak (result_size,response_status) {\n    tmp[&apos;QAK&apos;][&apos;QAK.1&apos;] = msg[&apos;QPD&apos;][&apos;QPD.2&apos;][&apos;QPD.2.1&apos;].toString();\n    tmp[&apos;QAK&apos;][&apos;QAK.2&apos;] = response_status;\n    tmp[&apos;QAK&apos;][&apos;QAK.4&apos;] = result_size; // number of result rows\n}\n\n\nfunction fill_qpd() {\n    tmp[&apos;QPD&apos;] = msg[&apos;QPD&apos;] //no difference from qpd segment coming from request message \n}\n\nfunction fill_pid(result) {\n    //var pid = getPIDTemplate(true)\n    var pid = createSegment(&apos;PID&apos;)\n    logger.info(pid.toString())\n    pid[&apos;PID.3&apos;] = result.getString(select_fields_mapping[&apos;PID_3&apos;]);\n    //pid[&apos;PID.3&apos;][&apos;PID.3.4&apos;][&apos;PID.3.4.1&apos;] = result.getString(select_fields_mapping[&apos;PID_3_4_1&apos;])    \n    //pid[&apos;PID.3&apos;][&apos;PID.3.4&apos;][&apos;PID.3.4.2&apos;] = result.getString(select_fields_mapping[&apos;PID_3_4_2&apos;])\n    //pid[&apos;PID.3&apos;][&apos;PID.3.4&apos;][&apos;PID.3.4.3&apos;] = result.getString(select_fields_mapping[&apos;PID_3_4_3&apos;]) \n    //pid[&apos;PID.3&apos;][&apos;PID.3.5&apos;] = result.getString(select_fields_mapping[&apos;PID_3_5&apos;])     \n    //pid[&apos;PID.3&apos;][0][&apos;CX.4&apos;][&apos;HD.1&apos;] = &apos;GALAWEB&apos;\n    //pid[&apos;PID.3&apos;][0][&apos;CX.5&apos;]\t= &apos;PI&apos;\n    //pid[&apos;PID.3&apos;][1][&apos;CX.1&apos;]\t= result.getString(select_fields_mapping[&apos;PID_3_1_CX1&apos;])\n    //pid[&apos;PID.3&apos;][1][&apos;CX.4&apos;][&apos;HD.1&apos;]\t= &apos;Ministero Delle Finanze&apos;\n    //pid[&apos;PID.3&apos;][1][&apos;CX.5&apos;]\t= &apos;CF&apos;\n    pid[&apos;PID.5&apos;][&apos;PID.5.1&apos;][&apos;PID.5.1.1&apos;] = result.getString(select_fields_mapping[&apos;PID5_1_1&apos;] );\n    pid[&apos;PID.5&apos;][&apos;PID.5.2&apos;] = result.getString(select_fields_mapping[&apos;PID5_2&apos;]);\n    pid[&apos;PID.5&apos;][&apos;PID.5.7&apos;] = &apos;L&apos;;\n    pid[&apos;PID.7&apos;][&apos;PID.7.1&apos;] = DateUtil.convertDate(&quot;yyyy-MM-dd&quot;, &quot;yyyyMMdd&quot;,result.getString(select_fields_mapping[&apos;PID7_1&apos;]));\n    pid[&apos;PID.8&apos;] = result.getString(select_fields_mapping[&apos;PID8&apos;]);\n    pid[&apos;PID.11&apos;][&apos;PID.11.1&apos;] = result.getString(select_fields_mapping[&apos;PID11_1_1&apos;]);\n    pid[&apos;PID.11&apos;][&apos;PID.11.2&apos;] = &apos;&apos; //other designation\n    pid[&apos;PID.11&apos;][&apos;PID.11.3&apos;] = result.getString(select_fields_mapping[&apos;PID11_3&apos;]);\n    pid[&apos;PID.11&apos;][&apos;PID.11.4&apos;] = result.getString(select_fields_mapping[&apos;PID11_4&apos;]);\n    pid[&apos;PID.11&apos;][&apos;PID.11.5&apos;] = result.getString(select_fields_mapping[&apos;PID11_5&apos;]);\n    // pid[&apos;PID.11&apos;][&apos;PID.11.6&apos;] = &apos;100&apos;;\n    pid[&apos;PID.11&apos;][&apos;PID.11.7&apos;] = &apos;H&apos;;\n    //pid[&apos;PID.11&apos;][0][&apos;XAD.9&apos;] = result.getString(select_fields_mapping[&apos;PID11_0_XAD9&apos;]);\n\t\t\n    //second pid.11: blank \n    //pid[&apos;PID.11&apos;][1][&apos;XAD.1&apos;][&apos;SAD.1&apos;] = &apos;&apos;,\n    //pid[&apos;PID.11&apos;][0][&apos;XAD.2&apos;] = &apos;&apos;; //other designation\n    //pid[&apos;PID.11&apos;][1][&apos;XAD.3&apos;] = &apos;&apos;;\n    //pid[&apos;PID.11&apos;][1][&apos;XAD.4&apos;] = &apos;&apos;;\n    //pid[&apos;PID.11&apos;][1][&apos;XAD.5&apos;] = &apos;&apos;;\n    //pid[&apos;PID.11&apos;][1][&apos;XAD.6&apos;] = &apos;100&apos;;\t\n    //pid[&apos;PID.11&apos;][1][&apos;XAD.7&apos;] = &apos;L&apos;;\n    //pid[&apos;PID.11&apos;][1][&apos;XAD.9&apos;] = &apos;&apos;;\n    \n    //pid[&apos;PID.13&apos;][&apos;XTN.1&apos;] = result.getString(select_fields_mapping[&apos;PID13&apos;]);\n    //pid[&apos;PID.14&apos;][&apos;XTN.1&apos;] = result.getString(select_fields_mapping[&apos;PID14&apos;]);\n    //pid[&apos;PID.16&apos;][&apos;CE.1&apos;] = result.getString(select_fields_mapping[&apos;PID16&apos;]);\n    //pid[&apos;PID.23&apos;] = result.getString(select_fields_mapping[&apos;PID23&apos;]);\n    //pid[&apos;PID.26&apos;][&apos;CE.1&apos;] = result.getString(select_fields_mapping[&apos;PID26&apos;]);\n    //pid[&apos;PID.18&apos;][&apos;PID.18.1&apos;] = result.getString(select_fields_mapping[&apos;PID18&apos;]);\n    return pid;\n}\n\nfunction fill_qri() {\n    //qri = tmp[&apos;RSP_K21.QUERY_RESPONSE&apos;][&apos;QRI&apos;]\n    //qri[&apos;QRI.1&apos;]\t\t = &apos;100&apos;\n    //qri[&apos;QRI.3&apos;][&apos;CE.1&apos;] = &apos;MATCH&apos;\n    return tmp[&apos;QRI&apos;][0];\n}</script>\n          </com.mirth.connect.plugins.javascriptstep.JavaScriptStep>\n          <com.mirth.connect.plugins.javascriptstep.JavaScriptStep version="4.5.1">\n            <name>Execute Label Information Query retrieving</name>\n            <sequenceNumber>4</sequenceNumber>\n            <enabled>true</enabled>\n            <script>/*LIS DATABASE PARAMETER INFO*/\n\nimportPackage(java.util);\n//get url parameters from channel map\n\nvar pdq_db_params = channelMap.get(&apos;pdq_db_params&apos;);\nconn_drv = pdq_db_params[&apos;driver&apos;];\nconn_str = pdq_db_params[&apos;url&apos;];\nconn_usr = pdq_db_params[&apos;user&apos;];\nconn_pwd = pdq_db_params[&apos;password&apos;];\n\nvar patients = new ArrayList();\n\nvar db_conn = DatabaseConnectionFactory.createDatabaseConnection(conn_drv,conn_str,conn_usr,conn_pwd);\nlogger.error(&quot;QRY: &quot; + query)\n\ntry {\n    var result = db_conn.executeCachedQuery(query);\n    if (result.size() != 0) {\n        fill_qak(result.size(),&apos;OK&apos;);\n        while (result.next()) {\n            logger.info(&apos;Adding patient&apos;);\n            var patient = fill_pid(result);\n            patients.add(patient);\n        }\n    }\n    else if (result.size() == 0) {\n        logger.warn(&apos;Empty resultset&apos;);\n        error_control[&apos;code&apos;] = &apos;002&apos;;\n        error_control[&apos;desc&apos;] = &apos;Empty resultset, no data found&apos;;\n        channelMap.put(&apos;error_control&apos;,error_control);\n        channelMap.put(&apos;msg&apos;,msg)\n    }\n}\ncatch(e) {\n    logger.error(CHANNEL_NAME + &quot;: PDQ Server. &quot; + &quot;Error reading data from the database.\\n&quot; +\n    &quot;----- ERROR DETAILS -----\\n&quot; + \n    e.message +\n    &quot;\\n----- END OF ERROR DETAILS  -----&quot;);\n    logger.error(CHANNEL_NAME+&apos;:PDQ Server: &apos; + &apos;saving error to the global map&apos;);\n    error_control[&apos;code&apos;] = &apos;001&apos;;\n    error_control[&apos;desc&apos;] = &apos;Database connection error&apos;\n    channelMap.put(&apos;error_control&apos;, error_control)\n    channelMap.put(&apos;msg&apos;, msg);\n}</script>\n          </com.mirth.connect.plugins.javascriptstep.JavaScriptStep>\n          <com.mirth.connect.plugins.javascriptstep.JavaScriptStep version="4.5.1">\n            <name>Create rsp message</name>\n            <sequenceNumber>5</sequenceNumber>\n            <enabled>true</enabled>\n            <script>/* Fills a response message with the incoming query fields, if no errors before occurred*/\nlogger.info(CHANNEL_NAME + &apos;: Incoming Message Success LAB-62 Destination Transformer: Creating response global message&apos;)\nif((channelMap.get(&apos;error_control&apos;))[&apos;code&apos;] == &apos;000&apos;) {\n    //var qri = fill_qri()\n    delete tmp[&apos;PID&apos;][0];\n    fill