rn false\n}\n\n//CASE 2 - Request Query field is not empty but contains error:a query field has the wrong code, or has the correct code, \n//but the value is empty\n\nfor (var i=0; i&lt;(msg[&apos;QPD&apos;][&apos;QPD.3&apos;]).length(); i++){\n\tlogger.info (&apos;starting fields code validation.........&apos;)\n\tlogger.info(&apos;validation:&apos;+validate_code(msg[&apos;QPD&apos;][&apos;QPD.3&apos;][i][&apos;QPD.3.1&apos;].toString()))\n\tvar code \t\t= msg[&apos;QPD&apos;][&apos;QPD.3&apos;][i][&apos;QPD.3.1&apos;].toString()\n\tvar value \t\t= msg[&apos;QPD&apos;][&apos;QPD.3&apos;][i][&apos;QPD.3.2&apos;].toString() \n\tlogger.info(code)\n\tif((validate_code(code) == false) || value == &apos;&apos;) return false //reject\n\t\n}\n\n\nreturn true //pass</script>\n          </com.mirth.connect.plugins.javascriptrule.JavaScriptRule>\n        </elements>\n      </filter>\n      <transportName>JavaScript Writer</transportName>\n      <mode>DESTINATION</mode>\n      <enabled>true</enabled>\n      <waitForPrevious>true</waitForPrevious>\n    </connector>\n    <connector version="4.5.1">\n      <metaDataId>2</metaDataId>\n      <name>PDQ request failure destination</name>\n      <properties class="com.mirth.connect.connectors.js.JavaScriptDispatcherProperties" version="4.5.1">\n        <pluginProperties/>\n        <destinationConnectorProperties version="4.5.1">\n          <queueEnabled>false</queueEnabled>\n          <sendFirst>false</sendFirst>\n          <retryIntervalMillis>10000</retryIntervalMillis>\n          <regenerateTemplate>false</regenerateTemplate>\n          <retryCount>0</retryCount>\n          <rotate>false</rotate>\n          <includeFilterTransformer>false</includeFilterTransformer>\n          <threadCount>1</threadCount>\n          <validateResponse>false</validateResponse>\n          <resourceIds class="linked-hash-map">\n            <entry>\n              <string>Default Resource</string>\n              <string>[Default Resource]</string>\n      